#!/bin/perl -w
#
# https://adventofcode.com/2018/day/5

use strict;

print "2018 Day 5\n\n";
my $puzzle = do { local $/; <DATA> }; # slurp it

# create a giant regexp pattern for the cancellations
my $pattern = join('|', map { $_ . uc($_) . "|" . uc($_) . $_ } ('a' .. 'z'));

my $copy = $puzzle;
while ($copy =~ s/$pattern//g) {};
my $min = length $copy;
print "P1: After all reactions are finished, the polymer has $min remaining units.\n";

my $problem;
foreach my $c ('a' .. 'z') {
	my $remove = "[$c" . uc($c) . "]";
	$copy = $puzzle;
	$copy =~ s/$remove//g;
	while ($copy =~ s/$pattern//g) {};
	my $len = length $copy;
	if ($len < $min) {
		$min = $len;
		$problem = $remove;
	}
}
print "\nP2: After removing reactant $problem, the smallest number of remaining units is $min.\n";

__DATA__
